import { useState, useEffect } from "react";

export default function App() {
  fetch("https://pokeapi.co/api/v2/pokemon/ditto")
    .then()
    .catch((error) => console.error(error));

  return (
    <div>
      <h1>Food searching App</h1>
    </div>
  );
}
